import React, { useState } from "react";
import { StyleSheet, css } from "aphrodite";
import { Link } from "react-router-dom";

const Header = () => {
	return (
		<div className={css(classes.header)}>
			<div className={css(classes.headerList)}>
				<Link className={css(classes.headerComp)} value="home" to="/">
					HOME
				</Link>
				<Link
					className={css(classes.headerComp)}
					value="works"
					to="/works"
					// onClick={Navclick}
				>
					WORKS
				</Link>
				<Link
					className={css(classes.headerComp)}
					value="services"
					to="/services"
				>
					SERVICES
				</Link>
				<Link className={css(classes.headerComp)} vlaue="contact" to="/contact">
					CONTACT
				</Link>
				<Link className={css(classes.headerComp)} value="about" to="/about">
					ABOUT
				</Link>
			</div>
		</div>
	);
};

const classes = StyleSheet.create({
	header: {
		//color: "#585858",
		backgroundColor: "#1C1B1B",
		padding: 70,
		textDecoration: "none",
		display: "flex",
		justifyContent: "center",
		alignItems: "center",
	},
	headerComp: {
		fontWeight: 500,
		fontSize: 18,
		textDecoration: "none",
		color: "#585858",
		":hover": {
			color: "#FFFFFF",
			fontWeight: 700,
		},
		"@media (max-width: 1280px)": {
			display: "none",
		},
	},
	headerList: {
		display: "flex",
		flexDirection: "row",
		justifyContent: "space-evenly",
		maxWidth: 480,
	},
});

export default Header;
